srl_nokia-acl:acl:
    acl-filter:
    -   entry:
        -   action:
                accept:
                    rate-limit:
                        system-cpu-policer: icmp
            description: Accept incoming ICMP unreachable messages
            match:
                ipv4:
                    icmp:
                        type: dest-unreachable
                    protocol: icmp
            sequence-id: 10
        -   action:
                accept:
                    rate-limit:
                        system-cpu-policer: icmp
            description: Accept incoming ICMP time-exceeded messages
