                accept:
                    rate-limit:
                        system-cpu-policer: icmp
            description: Accept incoming ICMP echo-reply messages
            match:
                ipv4:
                    icmp:
                        type: echo-reply
                    protocol: icmp
            sequence-id: 50
        -   action:
                accept: {}
            description: Accept incoming SSH when the other host initiates the TCP
                connection
            match:
                ipv4:
                    protocol: tcp
                transport:
                    destination-port:
                        operator: eq
                        value: 22
            sequence-id: 60
        -   action:
                accept: {}
            description: Accept incoming SSH when this router initiates the TCP connection
            match:
                ipv4:
                    protocol: tcp
                transport:
                    source-port:
